  return (
    <section id="about">
      <div className="container mx-auto flex px-1 py-4 md:flex-row flex-col items-center">
        <div className="flex items-center flex-wrap justify-center">
          <div className='flex flex-row justify-center w-auto'>
            <h1 className="title-font sm:text-4xl text-3xl mb-4 font-medium text-white flex justify-center">
              <Typical
                steps={["Hi, I am Gabriel", 1000]}
                loop={Infinity}
                wrapper="p"
              />
            </h1>
          </div>
          <div>
    <p className='justify-center'>
    As a seasoned Manager in Social Services with years of experience leading teams and managing complex projects, I am now pursuing a new career path in Web Development. With a strong foundation in leadership, strategic planning, and problem-solving. I have completed a rigorous Web Development Bootcamp through the University of Toronto. 
    </p>

          </div>
        </div>
      </div>
    </section>
  );
}
